import React from 'react';
import { fieldCreator, InputForm } from '../../common/FormsControls/FormsControls';
import { reduxForm } from 'redux-form';
const ProfileDataForm = ({ profile }) => {
    return (
        <form>
        <div><button onClick= {() =>{}}>Save</button></div>
        <b>Имя:</b> {fieldCreator('Full name', 'fullName', InputForm, [])}<br />
        <b>В поисках работы?: </b>{fieldCreator('', 'lookingForAJob', InputForm, [], 'checkbox')}<br />
        <b>В поисках работы?: </b>{profile.lookingForAJob ? 'Да' : 'Нет'}<br/>
        {profile.lookingForAJob && <div><b>My professional skills: </b>{profile.lookingForAJobDescription}<br /></div>}
        <b>About me: </b>{profile.aboutMe}<br />
        {/* {Object.keys(profile.contacts).map(key => {
          return <Contact contactTitle={key} contactValue={profile.contacts[key]} />
        })} */}

      </form>)
  }

const ProfileDataFormReduxForm = reduxForm({form:'edit-form'})(ProfileDataForm)

  export default ProfileDataFormReduxForm;
